import React from 'react';
import ReactECharts from 'echarts-for-react';

const Page = () => {
  const option = {
    title: {
      text: 'ECharts 入门示例'
    },
    tooltip: {},
    legend: {
      data:''
    },
    xAxis: {
      data: ''
    },
    yAxis: {},
    series: [{
      name: '',
      type: '',
      data: ''
    }]
  };

  return <ReactECharts
    option={option}
    style={{ height: 400 }}
    opts={{ renderer: 'svg' }}
  />;
};

export default Page;
